import React from "react";
import { useHistory } from "react-router-dom";
import HomeImg from "../assets/homescreen.png";
const Home = () => {
  const history = useHistory();
  return (
    <div className="max-w-full max-h-screen text-center">
      
      <main>
        <div className="mt-7 g-56 grid grid-cols-2">
          <div className="font-mono flex flex-col self-center py-3">
            <h1 className="flex flex-col text-5xl font-bold">
              <span>La Vie</span>
              <span className="text-lg">When your heart speaks, take good notes</span>
            </h1>
          </div>
          <div>
            <img
              src={HomeImg}
              alt="home"
              className="hidden w-10/12  object-fit lg:block"
            />
          </div>
        </div>
      </main>
    </div>
  );
};

export default Home;
